"DT_node_lookup_0" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_3", t1."Leaf_5", t1."Leaf_7", t1."Leaf_8", t1."Leaf_13", t1."Leaf_14", t1."Leaf_18", t1."Leaf_19", t1."Leaf_20", t1."Leaf_23", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_29", t1."Leaf_30", t1."Leaf_32", t1."Leaf_33", t1."Leaf_35", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_54" > 7.000000) AND (t."X_2" <= 3.500000)) THEN 3 ELSE NULL END AS "Leaf_3",
      CASE WHEN((t."X_54" > 7.000000) AND (t."X_2" > 3.500000) AND (t."X_35" <= 5.000000)) THEN 5 ELSE NULL END AS "Leaf_5",
      CASE WHEN((t."X_54" > 7.000000) AND (t."X_2" > 3.500000) AND (t."X_35" > 5.000000) AND (t."X_1" <= 1.000000)) THEN 7 ELSE NULL END AS "Leaf_7",
