      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" <= 4.500000) AND (t."X_2" > 7.000000)) THEN 26 ELSE NULL END AS "Leaf_26",
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" > 6.500000) AND (t."X_34" <= 15.500000) AND (t."X_3" > 14.500000) AND (t."X_35" <= 5.000000)) THEN 29 ELSE NULL END AS "Leaf_29",
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" > 6.500000) AND (t."X_34" <= 15.500000) AND (t."X_3" > 14.500000) AND (t."X_35" > 5.000000)) THEN 30 ELSE NULL END AS "Leaf_30",
