      CASE WHEN((t."X_46" <= 8.500000) AND (t."X_60" > 2.500000) AND (t."X_51" <= 15.500000) AND (t."X_50" > 11.000000) AND (t."X_28" > 6.500000) AND (t."X_60" > 10.000000) AND (t."X_54" > 0.500000)) THEN 22 ELSE NULL END AS "Leaf_22",
