      CASE WHEN((t."X_46" <= 8.500000) AND (t."X_60" > 2.500000) AND (t."X_51" <= 15.500000) AND (t."X_50" <= 11.000000) AND (t."X_25" > 2.500000) AND (t."X_3" > 7.500000) AND (t."X_53" > 11.500000) AND (t."X_54" > 1.000000)) THEN 30 ELSE NULL END AS "Leaf_30",
      CASE WHEN((t."X_46" <= 8.500000) AND (t."X_60" > 2.500000) AND (t."X_51" <= 15.500000) AND (t."X_50" <= 11.000000) AND (t."X_25" > 2.500000) AND (t."X_3" > 7.500000) AND (t."X_53" <= 11.500000) AND (t."X_51" <= 8.500000)) THEN 31 ELSE NULL END AS "Leaf_31",
