      CASE WHEN((t."X_46" <= 8.500000) AND (t."X_60" > 2.500000) AND (t."X_51" <= 15.500000) AND (t."X_50" <= 11.000000) AND (t."X_25" <= 2.500000) AND (t."X_26" <= 2.000000)) THEN 33 ELSE NULL END AS "Leaf_33",
