      CASE WHEN((t."X_34" > 2.500000) AND (t."X_35" > 5.000000) AND (t."X_3" > 7.500000) AND (t."X_3" > 9.500000) AND (t."X_1" <= 0.500000) AND (t."X_58" > 3.500000) AND (t."X_36" > 13.500000) AND (t."X_6" <= 9.000000)) THEN 35 ELSE NULL END AS "Leaf_35",
