      CASE WHEN((t."X_36" > 6.000000) AND (t."X_5" <= 12.500000) AND (t."X_10" > 10.500000) AND (t."X_42" <= 5.500000) AND (t."X_10" <= 15.500000) AND (t."X_61" <= 10.500000) AND (t."X_2" > 2.000000)) THEN 28 ELSE NULL END AS "Leaf_28",
