      CASE WHEN((t."X_36" > 6.000000) AND (t."X_5" <= 12.500000) AND (t."X_10" <= 10.500000) AND (t."X_10" > 3.500000) AND (t."X_2" > 0.500000) AND (t."X_42" <= 6.000000)) THEN 35 ELSE NULL END AS "Leaf_35",
      CASE WHEN((t."X_36" > 6.000000) AND (t."X_5" <= 12.500000) AND (t."X_10" <= 10.500000) AND (t."X_10" > 3.500000) AND (t."X_2" > 0.500000) AND (t."X_42" > 6.000000) AND (t."X_2" <= 3.500000)) THEN 37 ELSE NULL END AS "Leaf_37",
